      checkOut: "",
      refID: "",
      roomCapacity: "",
      roomType: "",
      apiRespone: [],
      roomType: [],
    };
  },
  computed: {
    totalPeople() {
      return this.roomCapacity.adults + this.roomCapacity.child;
    },
    formattedCheckIN() {
      return this.formatDate(this.checkIN);
    },
    formattedCheckOut() {
      return this.formatDate(this.checkOut);
    },
  },
  methods: {
    logout() {
      this.$auth.setAuthToken(null);
      localStorage.removeItem("userEmail");
      localStorage.removeItem("guest_id");
      this.$router.push("/home");
    },
    getChildCapacity(childString) {
      return parseInt(childString.replace(/[\[\]]/g, ""));
    },
    formatDate(dateString) {
      const date = new Date(dateString);

      const months = [
        "January",
        "February",
        "March",
        "April",
        "May",
        "June",
        "July",
        "August",
        "September",
        "October",
        "November",
        "December",
      ];

      const month = months[date.getMonth()];
      const day = date.getDate();
      const daySuffix = this.getDaySuffix(day);
      const year = date.getFullYear();

      return `${month} ${day}${daySuffix} ${year}`;
    },
    getDaySuffix(day) {
      if (day > 3 && day < 21) return "th";
      switch (day % 10) {
        case 1:
          return "st";
        case 2:
          return "nd";
        case 3:
          return "rd";
        default:
          return "th";
      }
    },
    async updateUserProfile() {
      const runtimeConfig = useRuntimeConfig();
      const guest_id = this.$route.query.guest_id;

      if (
        this.editModeFirstName ||
        this.editModeLastName ||
        this.editModeEmail ||
        this.editModePhoneNumber ||
        this.editModeAddress
      ) {
        toast.error("Please save your changes");
        return;
      }

      const body = {
        name: this.firstName,
        lname: this.lastName,
        phone: this.phoneNumber,
        email: this.email,
        address: this.address,
      };

      const cookies = document.cookie.split(";");
